import React from "react";

function Contact() {
  return (
    <section className="container" >
      <div className="row">
      <h1 className="my-3"> Contact </h1>
  
        <div className="col-4"> 
        <label className="form-label">Name</label>
        <input className="form-control" placeholder="Name" type="email"></input>
      </div>


        <div className="col-4">
        <label className="form-label">Email adddress</label>
        <input className="form-control" placeholder="email@example.com" type="email"></input>
   

        <label className="form-label">Comment</label>
        <textarea className="form-control" rows="3"></textarea>
      </div>
   
      </div>
  
    </section>
  );
}

export default Contact;
